import * as React from 'react';
import { DataGrid } from '@material-ui/data-grid';

const columns = [
  { field: 'id', headerName: 'ID', width: 70, type: 'number' },
  { field: 'number', headerName: 'Número', width: 130, type: 'number' },
];

// const rows = [
//   { id: 0, number: 13 },
//   { id: 1, number: 17 },
//   { id: 2, number: 19 },
// ];
const rows = [
  { id: 1, number: 'Snow' },
  { id: 2, number: 'Lannister' },
  { id: 3, number: 'Lannister', firstName: 'Jaime', age: 45 },
  { id: 4, number: 'Stark', firstName: 'Arya', age: 16 },
  { id: 5, number: 'Targaryen', firstName: 'Daenerys', age: null },
  { id: 6, number: 'Melisandre', firstName: null, age: 150 },
  { id: 7, number: 'Clifford', firstName: 'Ferrara', age: 44 },
  { id: 8, number: 'Frances', firstName: 'Rossini', age: 36 },
  { id: 9, number: 'Roxie', firstName: 'Harvey', age: 65 },
];

export default function DataTable() {
  return (
    <div>
      <DataGrid rows={rows} columns={columns} pageSize={5} checkboxSelection />
    </div>
  );
}
